import React from "react";
import { FaLinkedin, FaInstagram, FaTwitter } from "react-icons/fa";

function App() {
  return (
    <div>
      <footer style={styles.footer}>
        <div style={styles.footerContainer}>
          {/* Left Section */}
          <div style={styles.footerLeft}>
            <h2>Teckleap</h2>
            <p>Headquarters</p>
            <p>📍 1910 Pacific Ave, Suite 2000, Dallas, TX 75201</p>
            <p>
              📞 <a href="tel:+14692777001" style={styles.link}>+1 (469) 277-7001</a>
            </p>
            <p>
              📧 <a href="mailto:info@teckleap.com" style={styles.link}>info@teckleap.com</a>
            </p>
            <div style={styles.socialIcons}>
              <a href="#" style={styles.icon}><FaLinkedin /></a>
              <a href="#" style={styles.icon}><FaInstagram /></a>
              <a href="#" style={styles.icon}><FaTwitter /></a>
            </div>
          </div>

          {/* Right Section */}
          <div style={styles.footerRight}>
            <h3>Links</h3>
            <div style={styles.linksContainer}>
              <ul style={styles.list}>
                <li><a href="#" style={styles.link}>Home</a></li>
                <li><a href="#" style={styles.link}>Services</a></li>
                <li><a href="#" style={styles.link}>Industries</a></li>
                <li><a href="#" style={styles.link}>Workforce Management</a></li>
              </ul>
              <ul style={styles.list}>
                <li><a href="#" style={styles.link}>Careers</a></li>
                <li><a href="#" style={styles.link}>Diversity</a></li>
                <li><a href="#" style={styles.link}>Locations</a></li>
                <li><a href="#" style={styles.link}>Contact Us</a></li>
              </ul>
            </div>
          </div>
        </div>
        <p style={styles.copyright}>© Copyright 2024. All Rights Reserved.</p>
      </footer>
    </div>
  );
}

// CSS Styling as JavaScript Object
const styles = {
  footer: {
    background: "#111",
    color: "white",
    padding: "20px 0",
    textAlign: "center",
  },
  footerContainer: {
    display: "flex",
    justifyContent: "space-around",
    flexWrap: "wrap",
    maxWidth: "1200px",
    margin: "auto",
  },
  footerLeft: {
    textAlign: "left",
    maxWidth: "300px",
  },
  link: {
    color: "white",
    textDecoration: "none",
  },
  socialIcons: {
    marginTop: "10px",
  },
  icon: {
    color: "white",
    fontSize: "20px",
    marginRight: "10px",
    textDecoration: "none",
  },
  footerRight: {
    textAlign: "left",
  },
  linksContainer: {
    display: "flex",
  },
  list: {
    listStyle: "none",
    padding: "0 20px",
  },
  copyright: {
    marginTop: "20px",
    fontSize: "14px",
  },
};

export default App;
